import { useSelector } from "react-redux";
import { NavLink } from "react-router-dom";



const Cart = () => {

  const {cart} = useSelector((state) => state);

  return (
    <div>
    {
      cart.length > 0 ? 
      (<div>
          <div>
            {
              cart.map((item, index) =>{
                return <CartItem key= {item.id} item= {item}  />
              })
            }
          </div>
      </div>) :
      (<div>
        <h1>YourCart is Empty</h1>
        <NavLink to ="/">
          <buton>
            Shop Now
          </buton>
        </NavLink>
      </div>)
    }
    </div>
  );
};

export default Cart;
